import React from 'react';
import { Button } from '@mui/material';
function Btn({isRunning, toggle, reset}) {
    return (
        <>
           <Button onClick={toggle}>
        {isRunning ? 'Pause' : 'Start'}
      </Button>
      <Button color="error" onClick={reset}>Reset</Button>
        </>
    )
}

export default Btn;
